import React, { Component } from 'react';
import './App.css';
import StackGrid from "react-stack-grid";
import Button from '@material-ui/core/Button';


class App extends Component {
  render() {
    return (
      <StackGrid column-width={100}>
        <Button variant="outlined pa6 br4" key="key1" onClick="https://github.com/katiemacaulay/Javascript-211-Checkpoints/tree/checkpoint1">Project 1</Button>
        <Button variant="outlined pa6 br4" key="key2" onClick="https://github.com/katiemacaulay/Javascript-211-Checkpoints/blob/checkpoint2/checkpoint2/checkpoint2.js">Project 2</Button>
        <Button variant="outlined pa6 br4" key="key3" onClick="https://katiemacaulay.github.io/checkpoint/checkpoint3/">Project 3</Button>
      </StackGrid>
      );
    }
  }

  export default App;
